import React from "react";
import "./stylo.css";
import Header from "../../componentes/header";
import Footer from "../../componentes/footer";
import Buscar from "../../componentes/busca";
import Carrosel from "../../componentes/carrosel";
import Quem_somos from "../../componentes/sobre";

function Home() {
    return (
        <section>
            <Header />
            <img className="d-block w-100" src="https://i.imgur.com/9ARLDGb.jpg" alt="background" />
            <Buscar />
            <br />
            <br />
            <Carrosel />
            <div class="d-grid btn-lg gap-2 col-2 mx-auto">
                <button class="btn btn-primary" type="button"> <a href="http://localhost:3000/Promocoes"></a> Promoções</button>
            </div>
            <Quem_somos />
            <Footer />
        </section>
    );
}
export default Home;
